import React from 'react'
import './LogoLateral.css'

import logo from './Logo.png'

// eslint-disable-next-line import/no-anonymous-default-export
export default () => (
         <div class="Logo">
            <img id="Imagem" src={logo} alt="Logo" />
        </div>   
)
